import React, { useContext } from 'react';
import TaskState from './TaskState';
import Noteitem from './Noteitem';

export default function Note() {
  const { notes } = useContext(TaskState);
  return (
    <div className='my-3'>
      {notes.map((note) => {
        return <Noteitem key={note.id} note={note} />;
      })}
    </div>
  );
}
